import React, { PureComponent } from 'react';
import TimeNumber from "./TimeNumber.js";
import TotalNumbers from "./TotalNumbers.js";
import NumberTrends from "./NumberTrends.js";
import SexAge from "./SexAge.js";

export default class TouristChartRight extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div>
				<div className="chart-right-whole">
					<div className="chart-area">
						<div className="chart-title">文物统计</div>
						<Top1></Top1>
					</div>
					<div className="chart-area">
						<div className="chart-title">场馆环境实时数据</div>
						<Top2></Top2>
					</div>
					<div className="chart-area">
						<div className="chart-title">游客实时数据</div>
						<Top3></Top3>
					</div>
					<div className="chart-area">
						<div className="chart-title">场馆口碑</div>
						<Top4></Top4>
					</div>
				</div>
            </div>
        );
    }
}
